INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3245390189431', 'Confit canard', 'Cuisses de canard du Sud-Ouest, graisse de canard, sele 100% de ces ingrédients sont d\'origine française. Préparation : Mettez le confit dans une poêle à feu doux pour faire fondre la graisse. Gardez juste la matière grasse nécessaire à la cuisson et dorez les cuisses à feu vif (côté peau) pendant 5 min environ. Faites ensuite chauffer à feu doux (côté chair) pendant 10 min environ. Profitez de la graisse restante pour faire rissoler des champignons ou des pommes de terre. Conservation Avant ouverture, à conserver à l\'abri de la chaleur et de l\'humidité. Après ouverture, à conserver au réfrigérateur dans un récipient alimentaire non métallique et à consommer dans les 24h. A consommer de préférence avant le / NO de lot : voir sur l\'un des fonds de la boîte.', '', '24', '8.2', '0', '0', '', '24', '1.5', '0.590551181102362', '', '0');

