VALUES ('3245411914615', 'Tarte Fine, Thon Tomates Et Ciboulette, Surgelée, 290 Grammes, Marque Carrefour', 'i Utilisation / Gebruik Au four traditionnel (sans décongélation préalable) : Préchauffez votre four à 2500C après avoir enlevé la grille. Retirez le film plastique et placez la tarte sur la grille froide. Introduisez le tout dans le four et laissez cuire 10 à 13 minutes. La tarte est bien cuite lorsqu\'en la soulevant légèrement, la pâte reste rigide et ne s\'incurve pas en son milieu. Conservation : À conserver plusieurs mois à -180C dans un congélateur *** consommer de préférence avant la date indiquée sur le côté de l\'emballage. ATTENTION, NE PAS RECONGELER APRÈS DÉCONGÉLATION. @ ln de traditionele oven (zonder voorafgaand ontdooien) : Haal de rooster uit de oven en verwarm uw oven voor op 2500C. Verwijder de plastic folie en zet de taart op de koude rooster. Schuif de taart in de oven en laat ze ongeveer 10 tot 13 minuten bakken. De taart is goed gebakken als het deeg hard blijft en niet gebogen is in het midden wanneer u de taart lichtjes optilt. Bewaring : Bewaart meerdere maanden op -180C in een diepvriezer*** en ten minste houdbaar tot de datum vermeld op de zijkant van de verpakking. NA ONTDOOIING NIET OPNIEUW INVRIEZEN. Fabriqué en France par / Geproduceerd in Frankrijk door EMB 57630E pour / voor CM1. - CM1 09 69 39 7000', '', '7.6', '4.5', '20', '2.1', '1.8', '5.9', '0.96', '0.377952755905512', '', '1');

